let number = 1

/* 여기서는 다큐먼트쿼리셀렉터못씀 밑에있는건 가상이니까 아직 만들어지지않은거. 나중에 버추얼돔이 만들어지고나면 사용가능
이건 청사진같은거야. 아직 만들어지지않은.
그래서 온클릭 */

  return (
    <>
    <h1>1씩증가</h1>
    <button onClick>증가</button>
    <p>현재값 : {number}</p>
    </>
  );
}

